import Link from 'next/link';

const linkStyle = ({
    margin: 20,
    fontSize: 30,
    fontFamily: 'Roboto',
    fontWeight: 700,
    textDecoration: 'none',
    color: 'black',
    
    '&:hover': {
        backgroundColor: '#ff0000',
      }
})
 

const Navbar = () => (
    <div>
        <div className="container">
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/about">
                <a>About</a>
            </Link>
        </div>   
        <style jsx>{`
            a {
                color: black;
                margin: 20px;
                font-size: 30px;
                font-family: Roboto;
                text-decoration: none;

            }
    
            .container {
                text-align: center;
                padding: 2.5vh;
            }
        `} </style>
    </div>

);
  
  export default Navbar;
